import React from 'react';
import { ButtonGroup, Button } from 'react-bootstrap';

export const Continents = ({ continents }) => {
    const elements = []

    for (const cont of continents) {
        elements.push(<Button key={cont} variant="secondary">{cont}</Button>)
    }
    return (
        <div>
            <ButtonGroup key="continents" size="lg" className="mb-2">
                {continents.map(cont => <Button key={cont} variant="secondary">{cont}</Button>)}
            </ButtonGroup>
        </div>
    )

    function onContinentClick() {

    }
}
